import React from 'react';
import BarChart from './BarChart.js'
import {Container,Row,Col,Card} from 'react-bootstrap';

export default class Welcome extends React.Component{
	render(){
		return(		
			<Container>
				<Row>
					<Col>
						Neo Life Boutique Sales Data Report

					</Col>
				</Row>
				<Row>
					<Col>1,2</Col>
					<Col>2,3</Col>
				</Row>
            </Container>

		);
	}
}
